import React from "react";

const Head = props => (
  <div className="card text-center">
    <nav class="navbar sticky-top navbar-light bg-light">
        <a class="navbar-brand" href="#">Memory Game</a>
        <span class="navbar-text">
            Score: | Top Score:
        </span>
    </nav>
  </div>
);

export default Head;
